              <i className="material-icons">x</i>
              Heads Up <iframe src="https://giphy.com/embed/26n3JcZS59xgsKXkI" width="480" height="480" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/animation-illustration-coin-26n3JcZS59xgsKXkI">via GIPHY</a></p>
            </Link>
          </div>
        </nav>
      </div>
    );
  }
}
export default Navbar;
